import axios from 'axios';
import { useEffect, useState } from "react";
export function Profile(){
    const [imagePath, setImagePath] = useState('');
    useEffect(() => {
        // Здесь вы делаете запрос к серверу для получения пути к изображению
        axios.get('http://127.0.0.1:8000/api/v1/Friends')
            .then(response => {
                setImagePath(response.data);
                console.log(response.data) // предположим, что путь к изображению находится в поле `path` объекта ответа
            })
            .catch(error => {
                console.error('Ошибка при получении изображения:', error);
            });
    }, []);
    return(
        <>
            <div className="avatar">
                <img src="" alt="" />
            </div>
        </>
    );
}
